	if (this.customLoggableFn !== undefined) {
		const loggable = this.customLoggableFn(p);
		if (loggable != null) return loggable;
	}
	if (p instanceof URI) return `Uri(${p.toString(true)})`;

	try {
		return JSON.stringify(p, sanitize);
	} catch {
		return `<error>`;
	}
}

